import RoomWithTribalArt from "../assets/mobile/image-grid-1.jpg";

function YourDayAtTheGallery() {
  return (
    <div>
      <div className="YourDayAtTheGallery container">
        <img
          className="row align-self-center"
          src={RoomWithTribalArt}
          alt="RoomWithTribalArt"
        ></img>
        <h2 className="row align-self-start">YOUR DAY AT THE GALLERY</h2>
        <p className="row align-self-start">
          Wander through our distinct collections and find new insights about
          our artists. Dive into the details of their creative process.
        </p>
      </div>
    </div>
  );
}

export default YourDayAtTheGallery;
